import { MDBIcon } from "mdbreact";
import p from '../../img/profile.png';
import { makeStyles } from '@material-ui/core/styles';
// import Input from '@material-ui/core/Input';
// import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import React from 'react';
// import { connect } from 'react-redux';
import Button from '@material-ui/core/Button';
import { signIn } from '../../store/actions/signIn';
// import React from 'react';
// import { makeStyles } from '@material-ui/core/styles';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import AccountCircle from '@material-ui/icons/AccountCircle';
import "./Login.scss"
// const useStyles = makeStyles((theme) => ({
//   root: {
//     '& > *': {
//       margin: theme.spacing(1),
//     },
//   },
// }));

const useStyles = makeStyles((theme) => ({
  margin: {
    margin: theme.spacing(1),
  },
}));
const SignIn = (props) => {
  const classes = useStyles();
  let email = "";
  let password = "";
  return (
    <form className={classes.root} noValidate autoComplete="off">
      <img className='profile_img' src={p}></img>
      <br />
      <TextField  onChange={(e) => { email = e.target.value }} required
        className={"classes.margin"}
        id="input-with-icon-textfield"
        placeholder="Email"

        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
      <br/>
      <br/>
      <TextField
        className={"classes.margin"}
        id="input-with-icon-textfield"
        placeholder="Password"
        onChange={(e) => { password = e.target.value }} required
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
      <br/>
      <br/>
      <Button variant="contained" onClick={() => signIn(password, email)}>Login</Button>
    </form>








    // <>
    //   <form className={classes.root} noValidate autoComplete="off">
    //     <img className='profile_img' src={p}>
    //     </img>
    //     <MDBIcon icon="envelope-square" />
    //     <Input style={{ "display": "inline-block" }} placeholder="Email" inputProps={{ 'aria-label': 'description' }} onChange={(e) => { email = e.target.value }} required />
    //     <br />
    //     <LockOutlinedIcon />
    //     <Input style={{ "display": "inline-block" }} placeholder="Password" inputProps={{ 'aria-label': 'description' }} onChange={(e) => { password = e.target.value }} required />
    //     <br />
    //     <Button variant="contained" onClick={() => signIn(password, email)}>Login</Button>
    //   </form>
    // </>
  );
}




export default SignIn;
